  const handleToggle = () => {
    setPageOn((pageOn) => !pageOn);
  };

  return (
    <div className="study-page-all">
      {pageOn ? 

        <div className="study-off-box">
          <div className="study-off-info">

          </div>

          <div className="study-off-btn-box">

          </div>

        </div> 

        : <Quiz />
      }
      </div>
  );
}

export default Easy;
